import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {
  username: string = '';
  password: string = '';
  confirmPassword: string = '';

  constructor(private router: Router) {}

  register() {
    // Logika rejestracji użytkownika
    // Przykładowo, sprawdzanie poprawności danych i zapis do bazy danych

    if (this.password !== this.confirmPassword) {
      // Jeśli hasła nie pasują do siebie, wyświetl informację o błędzie
      alert('Hasła nie pasują do siebie!');
      return;
    }

    // Tutaj można dodać kod do rejestracji użytkownika
    // Przekieruj do widoku logowania po pomyślnej rejestracji
    this.router.navigate(['/login']);
  }
}
<div class="container">
  <h2>Rejestracja</h2>
  <form (ngSubmit)="register()">
    <div class="form-group">
      <label for="username">Nazwa użytkownika:</label>
      <input type="text" id="username" name="username" [(ngModel)]="username" required>
    </div>
    <div class="form-group">
      <label for="password">Hasło:</label>
      <input type="password" id="password" name="password" [(ngModel)]="password" required>
    </div>
    <div class="form-group">
      <label for="confirmPassword">Potwierdź hasło:</label>
      <input type="password" id="confirmPassword" name="confirmPassword" [(ngModel)]="confirmPassword" required>
    </div>
    <button type="submit" class="btn btn-primary">Zarejestruj</button>
  </form>
</div>
